INSERT INTO `ps_info_lang` VALUES
(1,1,1,'<h4>Sklep z włóczkami Włóczkowy Świat - włóczki, sznurki, pasmanteria <br /><br />Sklep internetowy Włóczkowy Świat to sklep pasmanteria. To miejsce, w którym znajdziesz wszystko to, czego potrzebujesz do swojego przyszłego projektu. To sklep stworzony z myślą o osobach, których pasją jest rękodzieło. Pasmanteria, w  której znajdziesz wszystkie potrzebne artykułu do tworzenia makram, robótek ręcznych, szydełkowania, dziergania i haftowania. Sklep Włóczkowy Świat oferuje szeroki wybór włóczek, sznurków i akcesoriów dziewiarskich. Dzięki temu, że jesteśmy sklepem internetowym. Możesz, kupić potrzebne artykuły bez wychodzenia z domu. Oferujemy produkty wysokiej jakości, w konkurencyjnych cenach.<br /><br />Oferta sklepu internetowego Włóczkowy Świat pozwoli Ci stworzyć wymarzone projekty hand made. Jeżeli nie dziergasz i nie szydełkujesz. Jednak szukasz prezentu dla osoby kochającej robótki ręczne, szydełkowanie lub wiązanie makram. To również sklep dla Ciebie. W sklepie Włóczkowy Świat znajdziesz szeroką ofertę produktów, które sprawdzą się jako pomysł na prezent.<br />Sklep z włóczkami Włóczkowy Świat, bogaty asortyment włóczek i akcesoriów dziewiarskich<br /><br />Cieszymy się, że rękodzieło znowu jest modne! Wychodząc naprzeciw nowym trendom, w naszym sklepie znajdziesz tradycyjne materiały w nowoczesnych wariantach. Oferta sklepu internetowego Włóczkowy Świat obejmuje między innymi różnorodne rodzaje i kolory włóczek. A także akcesoria i narzędzia do ich pracy. Naszym priorytetem jest dostarczanie najwyższej jakości produktów, które spełnią oczekiwania nawet najbardziej wymagających klientów. W tym celu starannie dobieramy oferowane przez nas produkty. Tak, aby mieć pewność, że każdy znajdzie coś dla siebie.<br /><br />Dzięki bogatej ofercie możesz stworzyć coś unikatowego i dopasować projekt do swoich indywidualnych potrzeb. Jeśli więc szukasz czegoś wyjątkowego, koniecznie odwiedź nasz sklep internetowy i przekonaj się sam. Odkryj razem z nami fascynujący świat włóczek i akcesoriów dziewiarskich. Poczuj w sobie moc do zmieniania otaczającej Cię przestrzeni! Naszym celem jest dostarczanie materiałów najwyższej jakości, które pozwolą Ci wyczarować coś naprawdę niezwykłego. Dlatego też, oprócz bogatej oferty produktowej, znajdziesz u nas także przydatne porady i inspirujące pomysły. Zapraszamy do Włóczkowego Świata!<br /><br />Włóczki do dziergania i szydełkowania<br /><br />W sklepie internetowym Włóczkowy Świat staramy się, żeby dostępne motki były niemal w 100% naturalne. W naszej ofercie, znajdziesz włóczki głównych producentów między innymi Drops, Wool and the Gang, Scheepjes, Katia, BC Garn. W tym popularne motki Crazy Sexy Wool, Drops Baby Merino, czy Drops Kid-Silk. Wysokiej jakości wełnę merino, moher, alpakę, wełnę peruwiańską, wełnę owczą. Dzięki naszym włóczkom wydziergasz odzież na każdą porę roku. W ofercie sklepu znajdziesz grube włóczki, które sprawdzą się w projektach jesiennych i zimowych. A także włóczki bawełniane i z bambusa, doskonałe na lato. Ponadto oferujemy włóczki wełniane, które są idealne na każdą porę roku. <br /><br />W sklepie internetowym wloczkowyswiat.pl kupisz bawełnę w towarzystwie wełny merino bądź lnu. Bawełnę premium oraz bawełnę organiczną. W ofercie posiadamy również włóczki z dodatkiem poliamidu doskonałe na skarpetki. Pamiętaj, że niektóre motki ze względu na swoją strukturę lub przeznaczenie powinny, mieć w składzie domieszkę np. poliamidu. Który zwiększa wytrzymałość przędzy. Do wyboru jest wiele kolorów i odcieni, dzięki czemu możesz stworzyć wyjątkowe projekty dziewiarskie. Wybierz swoje ulubione kolory i ciesz się przyjemnością szydełkowania i dziergania!<br />Druty do dziergania<br /><br />Dzierganie to czynność, która sprawia wiele radości i satysfakcji. Dzięki niej można stworzyć piękne i wyjątkowe rzeczy, które będą cieszyły oko przez długi czas. Aby jednak uzyskać taki efekt, potrzebne są odpowiednie narzędzia i materiały. Wśród nich na pewno nie mogłoby zabraknąć drutów do dziergania. Druty do robótek to jeden z podstawowych elementów potrzebnych do tego hobby. W naszym sklepie internetowym znajdziesz bardzo duży wybór drutów do dziergania. Druty wiodących producentów KnitPro, Tulip, DMC, Seeknit. Wśród nich znajdują się różne rodzaje i materiały, takie jak: drewniane, aluminiowe, bambusowe. Do wyboru są różne rozmiary: od 2 mm do 12 mm. Druty na żyłce od 25cm do 150 cm. W ofercie Włóczkowego Świata znajdziesz również druty wymienne, pończosznicze, druty do warkoczy oraz druty proste.<br /><br />Dzięki tak dużej ofercie bez problemu dopasujesz odpowiednie druty do każdej robótki. Jeśli chcesz kupić druty do dziergania, ale nie wiesz, jaki rodzaj będzie dla Ciebie najlepszy. Skontaktuj się z nami. Z przyjemnością pomożemy Ci wybrać idealny produkt!<br />Szydełka, szydełka tunezyjskie - bogata oferta na każdą kieszeń<br /><br />Chcemy żebyś w naszym sklepie internetowym każdy mógł kupić wszystko, to czego potrzebuje do robótek. Dlatego wprowadzamy nowości, poszerzamy ofertę. Chcemy żeby szydełka z naszej oferty były na każdą kieszeń. Dlatego znajdziesz szydełka znanych producentów takich jak KnitPro, Tulip, Clover, ale także ekonomiczne tańsze szydełka. Staramy się wychodzić na przeciw oczekiwaniom naszych klientów. W asortymencie Włóczkowego Świata znajdziesz szydełka afgańskie, tunezyjskie oraz szydełka na żyłce. Nasza bogata oferta na pewno pomoże Ci wybrać idealne narzędzie do Twoich prac ręcznych.<br /><br />Pasmanteria - zobacz wyjątkowe akcesoria dziewiarskie<br /><br />Chcąc zapewnić możliwość samodzielnego tworzenia modnych i nowoczesnych projektów hand made. Oddajemy w Twoje ręce pasmanterie z bogatym asortymentem akcesoriów dziewiarskich. Wśród których znajdziesz komfortowe druty i szydełka, praktyczne nożyczki, znaczniki dziewiarskie, agrafki. Nasza pasmanteria to miejsce, w którym możesz znaleźć najwyższej jakości produkty. Które ułatwią Ci pracę przy Twoich projektach. Rozumiemy, że każdy ma inny gust i potrzeby, dlatego przygotowaliśmy szeroki wybór akcesoriów dziewiarskich. A także dodatków do prac hand made. <br /><br />Inne akcesoria jakie znajdziesz w naszej ofercie to:<br /><br />    igły do włóczki<br />    żyłki do drutów<br />    ochraniacze do drutów<br />    łączniki do żyłek<br />    tamborki<br />    przyrząd do robienia pomponów<br />    naszywki<br /><br />Co ważne w naszym sklepie internetowym znajdziesz asortyment na każdą kieszeń. Zapraszamy !<br />Sznurek do makramy i nie tylko w konkurencyjnych cenach!<br /><br />Kochamy rękodzieło. Nasz sklep powstał z prawdziwej pasji i miłości do rękodzieła, która cały czas się rozwija. Dlatego w sklepie internetowym Włóczkowy Świat znajdziesz także sznurki! Sznurki bawełniane, sznurki do makramy, sznurki plecione, skręcane. Wszystkie grubości od 1.5mm i 3mm do nawet 9mm. W ofercie mamy też sznurki 3ply, sznurki sizalowe, sznurki wędliniarskie, ozdobne oraz sznurki jutowe bardzo popularne wśród naszych klientów.<br /><br />Wszystkie sznurki starannie wyselekcjonowane i tak dobrane, abyś mogła/mógł stworzyć z nich piękne rzeczy. W sklepie internetowym Włóczkowy Świat cenimy jakość, dlatego w naszej ofercie znajdziesz sznurki polskiego producenta Bobbiny. Są to sznurki wyjątkowej jakości i wyjątkowych kolorach. Do wyboru masz sznurki naturalne, beżowe, szałwiowe, w odcieniach pastelowych i wiele innych. Praca sznurkami Bobbiny to prawdziwa przyjemność. Dzięki nim wykonasz makramy, szydełkowe torby, dywany ozdoby, dodatki do mieszkania. Dzięki szerokiej gamie kolorystycznej oraz sznurkom w różnych długościach i szerokości zrealizujesz swoje pomysły.<br />Akcesoria do haftu<br /><br />W naszym sklepie internetowym dbamy o szeroką ofertę. Wiemy, że osoby kochające rękodzieło są wszechstronnie uzdolnione, i ciągle szukają nowych pomysłów na stworzenie czegoś wyjątkowego. Właśnie dlatego oprócz, włóczek i sznurków wprowadziliśmy także przybory do haftu. W naszej ofercie znajdziesz między innymi tamborki firmy DMC z drewna bukowego, które sprawdzą się idealnie podczas haftu. Nasze igły do haftu pochodzą od renomowanych producentów, takich jak Tulip i DMC.<br /><br />W ofercie posiadamy również wysokiej jakości mulinę DMC oraz tkaniny do haftu. W naszym sklepie internetowym znajdziesz również Punch Needle. Jest to narzędzie do wykonywania haftów pętelkowych na tkaninach. Punch Needle to idealne narzędzie dla osób, które chcą rozpocząć swoją przygodę z haftem pętelkowym. Dział z akcesoriami do haftu cały czas się powiększa, dlatego warto śledzić naszą stronę internetową, aby być na bieżąco ze wszystkimi nowościami.<br />W sklepie internetowym Włóczkowy Świat klient jest najważniejszy<br /><br />Tworząc przestrzeń pełną doskonałych produktów i inspiracji, tworzymy ją dla Ciebie! Sklep internetowy wloczkowyswiat.pl wychodzi Ci naprzeciw, oferując atrakcyjne ceny, korzystne rabaty i profesjonalną obsługę klienta. Sklep jest łatwy w obsłudze i ma przyjazną stronę internetową. Wyróżnia nas gotowość pomocy i terminowość w realizacji złożonych zamówień. Dla Twojego komfortu jesteśmy również obecni w mediach społecznościowych - znajdziesz nas na Facebooku i Instagramie!<br /><br /> Zapraszamy i życzymy udanych zakupów!</h4>'),
(1,1,2,'<h2>Custom Text Block</h2>\n<p><strong class=\"dark\">Lorem ipsum dolor sit amet conse ctetu</strong></p>\n<p>Sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit.</p>');
