(1,1,1,'<h2>SZCZEGÓŁY PRODUKTU I ZALECENIA</h2>\n<table>\n  <tr><td><strong>Skład włóczki:</strong></td><td>75 Superwash wool, 25% Nylon</td></tr>\n  <tr><td><strong>Waga motka:</strong></td><td>100 g</td></tr>\n  <tr><td><strong>Długość motka:</strong></td><td>około 400 m</td></tr>\n  <tr><td><strong>Rozmiar drutów zalecany przez producenta:</strong></td><td>2,5 mm - 3 mm</td></tr>\n  <tr><td><strong>Próba druty:</strong></td><td>10 x 10 cm = 25 oczek x 45 rzędów</td></tr>\n  <tr><td><strong>Włóczka nadająca się do filcowania</strong></td><td>nie</td></tr>\n  <tr><td><strong>Włóczka, którą można prać w pralce</strong></td><td>tak</td></tr>\n  <tr><td><strong>Zalecenia dotyczące prania</strong></td><td>można prać w pralce wybierając program do tkanin delikatnych w temperaturze 30°C / suszyć rozłożone na płasko</td></tr>\n</table>','','wloczka-skarpetkowa-recznie-farbowana-01','','','','włóczka skarpetkowa, ręcznie farbowana, 01','','','',''),
